import styled from "styled-components";

export const Back = styled.div`
  height: 100vh;
  width: 100vw;
  display: flex;
  font-size: 100%;
  justify-content: center;
  align-items: center;
  font-family: "Oswald", sans-serif;
  font-weight: bold;
  color: #fff;
`;
